document
    .getElementById("save-button")
    .addEventListener("click", function (event) {
        event.preventDefault();
        const { jsPDF } = window.jspdf;
        const pdf = new jsPDF("portrait"); // Establecer orientaciÃ³n a horizontal
        const cardBody = document.getElementById("form-container-impulsa"); // Selector del card-body

        // Aplicar la clase para ocultar elementos no deseados y cambiar apariencia de inputs
        document
            .querySelectorAll(".hide-on-pdf")
            .forEach((element) => element.classList.add("hidden-during-pdf"));
        document
            .querySelectorAll("input, textarea")
            .forEach((element) => element.classList.add("pdf-friendly-input"));

        html2canvas(cardBody).then((canvas) => {
            const imgData = canvas.toDataURL("image/png");

            // Ancho y alto deseados para la imagen en el PDF
            const desiredWidth = 150; // Ancho deseado en unidades del PDF
            const desiredHeight = 300; // Alto deseado en unidades del PDF

            // Calcular el ancho y alto de la imagen proporcionalmente
            const imgWidth = desiredWidth;
            const imgHeight = (canvas.height * desiredWidth) / canvas.width;

            pdf.addImage(imgData, "PNG", 30, 20, imgWidth, imgHeight); // Alinear la imagen en toda la hoja
            const logoImg =
                "data:image/png;base64,";
            const logoWidth = 20; // Ancho del logo
            const logoHeight = 20; // Altura del logo
            pdf.addImage(
                logoImg,
                "PNG",
                pdf.internal.pageSize.getWidth() - logoWidth - 10,
                10,
                logoWidth,
                logoHeight
            );

            // AÃ±adir fecha y hora en la parte inferior
            const date = new Date();
            const dateString = date.toLocaleString();
            pdf.setFontSize(10);
            pdf.text(dateString, 10, pdf.internal.pageSize.getHeight() - 10);

            // AÃ±adir secciÃ³n con texto y firma
            // Reemplaza con el DNI correcto
            const signatureImg =
                "data:image/png;base64,";
            const signatureWidth = 50; // Ancho de la firma
            const signatureHeight = 30; // Altura de la firma

            // PosiciÃ³n de la firma y del texto
            const signatureX = pdf.internal.pageSize.getWidth() - 70; // Mueve la firma 10 unidades mÃ¡s a la derecha
            const signatureY = pdf.internal.pageSize.getHeight() - 40; // Ajusta segÃºn sea necesario
            const textX = pdf.internal.pageSize.getWidth() - 78; // PosiciÃ³n del texto permanece igual
            const textY = signatureY + signatureHeight + 0.001; // Coloca el texto justo debajo de la firma

            // AÃ±adir firma
            pdf.addImage(
                signatureImg,
                "PNG",
                signatureX,
                signatureY,
                signatureWidth,
                signatureHeight
            );

            // Ajustar tamaÃ±o de la fuente y aÃ±adir texto
            pdf.setFontSize(10); // TamaÃ±o para el nombre
            pdf.text("GERENTE DE CACECOB E.I.R.L", textX, textY);
            pdf.setFontSize(10); // TamaÃ±o para el nombre
            pdf.text(
                "Dr. Walter Enrique Moncada Alburqueque",
                textX,
                textY + 3
            );

            pdf.save("detalle_venta_cacecob.pdf");

            // Remover la clase despuÃ©s de generar el PDF
            document
                .querySelectorAll(".hide-on-pdf")
                .forEach((element) =>
                    element.classList.remove("hidden-during-pdf")
                );
            document
                .querySelectorAll("input, textarea")
                .forEach((element) =>
                    element.classList.remove("pdf-friendly-input")
                );

            const form = document.getElementById("create_ventacacecob");
            $.ajax({
                type: "POST",
                url: form.action,
                data: $(form).serialize(),
                success: function (response) {
                    // Redirigir a la pÃ¡gina de los registros hechos
                    window.location.href = "/cacecobeirl/home";
                },
                error: function (error) {
                    console.error(error);
                    Swal.fire({
                        icon: "error",
                        title: "Error",
                        text: "ERROR: VENTA YA REGISTRADA",
                    });
                },
            });
        });
    });
